var output;

//format:

/*
"nodes": [
   {
     "id": "id1",
     "name": "name1",
     "val": 1
   },
   {
     "id": "id2",
     "name": "name2",
     "val": 10
   },
   (...)
],
"links": [
   {
       "source": "id1",
       "target": "id2"
   },
   (...)
]
}*/

function parseURL(url){

  var urlSbstr = url.substr(url.lastIndexOf('/')+1);
  urlSbstr = urlSbstr.replace(/_/g, ' ');

  if(urlSbstr === "Thomas Aquinas  Thomas Aquinas  1"){
    urlSbstr = "Thomas Aquinas";
  }
  return urlSbstr;
}



function fn(){
  var nodes = []
  var links = []

  var idA;
  var idB;
  var nodeCount = [];
  var nodeIDs = [];

  var arr = input.results.bindings;
  //console.log(arr[0]);
  for(var i=0; i<arr.length; i++){

    var person = parseURL(arr[i].p.value);
    var influenced = parseURL(arr[i].influenced.value);

    //if person not already a node, add
    if(!nodeCount.includes(person)){
      nodeCount.push(person);

      idA = i + "a";
      nodeIDs.push(idA);
      nodes.push({"id": idA, "name": person, "val": 1});
    }
    else{
      // person already added, find id;
      objA = nodes.find(a => {
         return a.name === person;
      });
      //increase value
      objA.val = objA.val + 1;
      idA = objA.id;

    }

    var objA;
    var objB;

    if(!nodeCount.includes(influenced)){
      nodeCount.push(influenced);
      idB = i + "b";
      nodes.push({"id": idB, "name": influenced, "val": 1});
      nodeIDs.push(idB);
    }
    else{
      objB = nodes.find(b => {
        return b.name === influenced;
      });

      idB = objB.id;

    }

    //add links
    links.push({"source" : idA, "target": idB});

  }

  //run back through and delete < 4 influenced
//  console.log("NODE IDS" + nodeIDs);
  for(var i = nodes.length - 1; i>=0; i--){

    if(nodes[i].val >= 11){
      nodes[i].val++;
    }
    if(nodes[i].val >= 17){
      nodes[i].val++;
    }
    if(nodes[i].val >= 23){
      nodes[i].val++;
    }
    if(nodes[i].val < 4){
    //  console.log(nodes[i]);
    //  var splicedID = nodes[i].id;
      //console.log(nodeIDs.indexOf(splicedID));

      for(var j = links.length - 1; j>=0;  j--){

        //if(nodes[i].val > 8)

        if(links[j].target === nodes[i].id || links[j].source === nodes[i].id){
          //if(nodeIDs.indexOf(nodes[i].id) -1){

          //  console.log("spliced link");
            console.log("spliced: " + links[j].target);
            links.splice(j,1);
          //}
        }

      }
      nodes.splice(i, 1);
    }


  }




  output = { "nodes" : nodes, "links" : links};

  //output
  console.log(JSON.stringify(output));
  //generate text file
//  var blob = new Blob([output], {type: "text/plain;charset=utf-8"});
  //   saveAs(blob, "dbTest.txt");
}


window.onload = fn;

